      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE ( NOT + 70 - + 87 + col2 + + ( + - col1 ) BETWEEN - + col1 AND + 80 - + + 14 + + - col1 + col0 );
  - name: tab0

outputs:
  - name: q4409.out
    data: |
      87	21	10
